  input: '"TEXT","F3N","","Regarding Info. Req. - Our solicitation materials include
    a clear and conspicuous request for contributor information regarding occupation
    and name of employer.  Our standard statement requesting this information is Federal
    law requires political committees to use their best efforts to collect and report
    the name, mailing address, occupation and name of employer of individuals whose
    contributions aggregate in excess of $200 in an election cycle.  We then provide
    space for the occupation and employer information to be listed.    When an individual
    does not provide this information to us we send a separate letter to the individual
    within 30 days of the donation, again asking for the information and we provide
    a pre-addressed envelope for them to return the response material.    We will
    file subsequent amended reports to properly report the receipt of any missing
    employer/occupation that is received subsequent to the filing of the original
    report.    Regarding our Cash disbursements - In starting up the campaign, we
    did not receive checks for several weeks.  As we needed to pay some expenses involved
    in starting up the campaign we took cash out of our account.  Once we received
    our checks we stopped this process.    Reimbursement entries - Some of our reimbursement
    entries are listed without supporting memo entries because the $200 threshold
    for the vendors was not met, but we do have the information."'
